body:
@brantPTS , this error is due to a shape inference bug in OnnxRuntime version 0.5. I was able to reproduce the error as well.

![image](https://user-images.githubusercontent.com/13698702/64729848-df689e80-d492-11e9-87a3-f7a95821cf64.png)


The fix is already checked into the master branch, and the Yolov3 model  runs successfully for me using the  snippet below.

You can build the DLLs from source to get the fix. If you need a NuGet package, you should be able to create one using the same file layout as in version 0.5, but using the bits from your local build. 

[InferenceTest.cs](https://github.com/microsoft/onnxruntime/blob/master/csharp/test/Microsoft.ML.OnnxRuntime.Tests/InferenceTest.cs)
``` c#
        [Fact]
        private void mytest()
        {
            var modelsDir = @"D:\modelsyolov3";
            var modelRoot = new DirectoryInfo(Path.Combine(modelsDir));
            foreach (var modelDir in modelRoot.EnumerateDirectories())
            {
                var onnxModelNames = modelDir.GetFiles("*.onnx");
                var onnxModelFileName = Path.Combine(modelsDir, modelDir.Name, onnxModelNames[0].Name);
                using (var session = new InferenceSession(onnxModelFileName))
                {
                    var testRoot = new DirectoryInfo(Path.Combine(modelsDir, modelDir.Name));
                    var testData = testRoot.EnumerateDirectories("test_data*").First();

                    ///// Load test data
                    var dataIn = LoadTensorFromFilePb(Path.Combine(modelsDir, modelDir.Name, testData.ToString(), "input_0.pb"));

                    ///// Create Inputs
                    var nov = new List<NamedOnnxValue>();
                    nov.Add(
                        NamedOnnxValue.CreateFromTensor<float>
                        ("input_1", new DenseTensor<float>(dataIn, new int[] { 1, 3, 416, 416 })));
                    nov.Add(
                        NamedOnnxValue.CreateFromTensor<float>
                        ("image_shape", new DenseTensor<float>(new float[] { 416, 416 }, new int[] { 1, 2 })));

                    ///// Run Session
                    using (var resnov = session.Run(nov))
                    {
                        var res = resnov.ToArray()[0].AsTensor<float>().ToArray<float>();
                    }
                }
            } //model
        }
```

@jignparm, that is great news - thank you for the prompt fix. I will try to build from source and test.  Any idea when a 0.6 release may be published on NuGet? 

Thanks,
Brant

issue.body:
### Problem:
When visualizing the YoloV3 ONNX model (https://github.com/onnx/models/tree/master/vision/object_detection_segmentation/yolov3) using Netron (https://lutzroeder.github.io/netron/), the dimensions of input_1 are given as float32[unk__576, 3, unk__577, unk__578], and the dimensions of image_shape are given as float32[unk_579, 2]. Similarly in Python, by accessing sess.get_inputs(), where sess is an InferenceSession loaded from yolov3.onnx, you obtain ['unk_576', 3, 'unk_577', 'unk_578'] for input_1, and ['unk_579', 2] for image_shape.

According to the documentation, one would expect the dimensions to be [1,3,416,416] and [1,2] respectively.

### Symptoms
This is problematic because:
- It seemingly prevents deployment with OnnxRuntime in C# (https://github.com/microsoft/onnxruntime)
- It seemingly prevents deployment with ML.NET in C# (https://github.com/dotnet/machinelearning)
- It is inconsistent with the README.md

Inference with an InferenceSession in the C# implementation of OnnxRuntime fails as an ArgumentOutOfRangeException is thrown when running the session:
> ◢ | $exception | {"Dimensions must be positive and non-zero\r\nParameter name: dimensions"} | System.ArgumentOutOfRangeException

### Issue with ONNX model or with C# OnnxRuntime?
I have not been able to find anything in the Onnx format specification which explains the 'unk_xxx' values. However, it is possible that such values are expected/have an interpretation that a Onnx backend should be able to handle, in which case my problem is not caused by a faulty ONNX model, but due to an issue ion the backend implementation.

### Details:
The Dimensions of the inputs obtained from session.InputMetaData in C#, where session is an instance of InferenceSession from Microsoft.ML.OnnxRuntime, are [-1,3,-1,-1] and [-1,2] respectively. 

Inference with the model works in the python implementation of OnnxRuntime.

The README.md for YoloV3 clearly specifies that the input should be (1x3x416x416) and (1x2) respectively. 

Inference in Python fails for inputs with shapes other than (1,3,416,416), which is expected from YoloV3.

The following is the code I used in C# to run inference with the model:

```C#
int gpuIndex = 0;
string modelPath = 'yolov3.onnx'
var session = new InferenceSession(modelPath, SessionOptions.MakeSessionOptionWithCudaProvider(gpuIndex));

// Create random input data tensors
int[] dim = {1,3,416,416};
float[] dummyInput = new float[dim[0]*dim[1]*dim[2]*dim[3]];
for (int i = 0; i < dummyInput.Length; i++)
{
    dummyInput[i] = 0.50f;
}
Tensor<float> inputImageTensor = new DenseTensor<float>(dummyInput, dim);
float[] dummyImageShape = new float[2];
dummyImageShape[0] = 416;
dummyImageShape[1] = 416;
int[] dim2 = {1, 2};
Tensor<float> imageShapeTensor = new DenseTensor<float>(dummyImageShape, dim2);

// Feed the input to the session and infer
var inputs = new List<NamedOnnxValue>()
{
    NamedOnnxValue.CreateFromTensor<float>("input_1", inputImageTensor),
    NamedOnnxValue.CreateFromTensor<float>("image_shape", imageShapeTensor)
};
session.Run(inputs);
`
